import './App.css';
import {BrowserRouter as Router, Route} from 'react-router-dom';
import Welcome from './screens/Welcome/index';
import Profile from './screens/Profile';

const App =()=>
<Router>
  <main className='App'>
    {/* <Welcome /> */}

    <Route path="/">
            <Welcome />
          </Route>
          <Route path="/profile">
            <Profile />
          </Route>

  </main>
  </Router>




export default App;
